import React, { useState } from 'react';
import EnhancedStockChart from './EnhancedStockChart';
import { ThemeProvider } from './ui';

const MarketDataDashboard = () => {
  return (
    <ThemeProvider>
      <EnhancedStockChart />
    </ThemeProvider>
  );
};

export default MarketDataDashboard;
